import React from 'react'

const Paragraph = () => {
  return (
    <section className="paragraph" id='paragraph'>
    <div className='text-black' id='Hero2'> 
    <div className='max-w-[800px] mt-[10px] w-full h-full mx-auto text-center flex flex-col mb-10 justify-center'>    
       <p className='md:text-xl text-lg text-black md:py-3 py-3'>“Un case study es un enfoque de investigación que se utiliza para generar una comprensión profunda y multifacética de un tema complejo en su contexto de la vida real. Es un proceso de investigación establecido que se usa en una amplia variedad de disciplinas, particularmente en las ciencias sociales”(Crowe, 2011). </p>
        </div>
        </div>
        </section>
  )
}

export default Paragraph;
